    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1648929694085,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1648940606811,"commentText":"<div><i>\"List every course name, section number, and professor name in chronological order for every section that has ever been offered.\"</i></div><div><br></div><div>Take a look at the attached ER Diagram and schema. I know that I am going to need the <font face=\"Courier\">Courses</font>, <font face=\"Courier\">Sections</font>, and <font face=\"Courier\">Professors</font> tables to retrieve the information in the prompt. I will start by joining these tables together.<br></div>","selectedCodeBlocks":[],"imageURLs":["media/images/1648939513288-image.png","media/images/1648939594331-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"","viewableBlogText":"","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-142":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-142","timestamp":1648929840060,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":142,"type":"INSERT","fileId":"fileId-0","character":";","previousNeighborId":"ev-141","lineNumber":4,"column":50,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1648940347621,"commentText":"<div>I start by joining all of the tables mentioned in the last comment and displaying all of the attributes.</div><div><br></div><div>There are 14 sections of courses offered in the database. The attached screenshot shows all of the sections along with the course and professor information for each section. I retrieved the course and professor information by following the foreign keys in the <font face=\"Courier\">Sections</font> table.<br></div><div><br></div><div>Note: some of the results are not visible in the attached screenshot.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"SELECT *\nFROM Courses, Sections, Professors\nWHERE Courses.courseID = Sections.courseID\nAND Sections.professorID = Professors.professorID;","startRow":0,"startColumn":0,"endRow":3,"endColumn":50}],"imageURLs":["media/images/1648930195313-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT *\nFROM Courses, Sections, Professors\nWHERE Courses.courseID = Sections.courseID\nAND Sections.professorID = Professors.professorID;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-246":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-246","timestamp":1648929989851,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":246,"type":"INSERT","fileId":"fileId-0","character":"a","previousNeighborId":"ev-240","lineNumber":1,"column":72,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1648940463291,"commentText":"Next, I limit the attributes being displayed to the course name, section id, semester, year, and professor name.<br>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Courses.name, Sections.sectionID, Sections.semester, Sections.year, Professors.last, Professors.first","startRow":0,"startColumn":7,"endRow":0,"endColumn":108}],"imageURLs":["media/images/1648930252800-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"0","linesBelow":"3","currentFilePath":"/q.sql","viewableBlogText":"SELECT Courses.name, Sections.sectionID, Sections.semester, Sections.year, Professors.last, Professors.first\nFROM Courses, Sections, Professors\nWHERE Courses.courseID = Sections.courseID\nAND Sections.professorID = Professors.professorID;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}],"ev-293":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-293","timestamp":1648930038506,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":293,"type":"INSERT","fileId":"fileId-0","character":"C","previousNeighborId":"ev-292","lineNumber":5,"column":46,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1649165283123,"commentText":"<div>Finally, I order the results chronologically. I start by sorting by the year that the section was offered. <br></div><div><br></div><div>There are only two semesters- Fall and Spring. Because Fall is considered the first semester of a school year, the second <font face=\"Courier\">ORDER BY</font> attribute is the semester but in descending order.</div><div><br></div><div>For example, all of the Spring 2007 courses were offered before the Fall 2007 courses.<br></div>","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"ORDER BY Sections.year, Sections.semester DESC","startRow":4,"startColumn":0,"endRow":4,"endColumn":46}],"imageURLs":["media/images/1648930295131-image.png"],"videoURLs":[],"audioURLs":[],"linesAbove":"4","linesBelow":"0","currentFilePath":"/q.sql","viewableBlogText":"SELECT Courses.name, Sections.sectionID, Sections.semester, Sections.year, Professors.last, Professors.first\nFROM Courses, Sections, Professors\nWHERE Courses.courseID = Sections.courseID\nAND Sections.professorID = Professors.professorID\nORDER BY Sections.year, Sections.semester DESC;","commentTags":["image"],"questionCommentData":null,"commentTitle":""}]};
